  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` varchar(50) NOT NULL,
  `id_owner` int(11) NOT NULL,
  `id_tz` int(5) NOT NULL DEFAULT 1,
  `code_erp` varchar(25) DEFAULT NULL,
  `description` varchar(250) DEFAULT NULL,
  `slug` varchar(250) NOT NULL,
  `date_from` datetime NOT NULL,
  `date_to` datetime NOT NULL,
  `date_execution` datetime NOT NULL COMMENT 'día y hora limite para validar el codigo',
  `content` varchar(2000) NOT NULL,
  `bgcolor` varchar(10) DEFAULT NULL,
  `bgimage_xs` varchar(500) DEFAULT NULL,
  `bgimage_sm` varchar(500) DEFAULT NULL,
  `bgimage_md` varchar(500) DEFAULT NULL,
  `bgimage_lg` varchar(500) DEFAULT NULL,
  `bgimage_xl` varchar(500) DEFAULT NULL,
  `bgimage_xxl` varchar(500) DEFAULT NULL,
  `invested` decimal(10,3) DEFAULT 0.000,
  `returned` decimal(10,3) DEFAULT 0.000,
  `max_confirmed` int(4) NOT NULL DEFAULT 0,
  `is_raffleable` int(2) NOT NULL DEFAULT 0,
  `is_cumulative` int(2) NOT NULL DEFAULT 0,
  `tags` varchar(500) DEFAULT NULL COMMENT 'palabras claves en los textos para poder hacer IA',
  `notes` varchar(300) DEFAULT NULL COMMENT 'notas de usuario sobre la promocion',
  `is_published` int(2) NOT NULL DEFAULT 0,
  `is_launched` int(2) NOT NULL DEFAULT 0 COMMENT 'si ya se ha publicado al menos una vez no se deberia poder editar cierta configuracion',
  `num_viewed` int(5) NOT NULL DEFAULT 0 COMMENT 'metricas de trazabilidad, veces vista',
  `num_subscribed` int(5) NOT NULL DEFAULT 0,
  `num_confirmed` int(5) NOT NULL DEFAULT 0,
  `num_executed` int(5) NOT NULL DEFAULT 0,
  `disabled_date` datetime DEFAULT NULL COMMENT 'datetime de la deshabilitacion',
  `disabled_user` varchar(15) DEFAULT NULL COMMENT 'deshabilitador (no necesariamente en base_user) puede ser un proceso ETL',
  `disabled_reason` varchar(1000) DEFAULT NULL COMMENT 'why is disabled',
  PRIMARY KEY (`id`),
  KEY `delete_date_idx` (`delete_date`),
  KEY `is_enabled_idx` (`is_enabled`),
  KEY `uuid_idx` (`uuid`),
  KEY `id_owner_idx` (`id_owner`),
  KEY `description_idx` (`description`),
  KEY `slug_idx` (`slug`),
  KEY `date_from_idx` (`date_from`),
  KEY `date_to_idx` (`date_to`),
  KEY `disabled_date_idx` (`disabled_date`),
  KEY `id__uuid_idx` (`id`,`uuid`),
  KEY `date_from__date_to_idx` (`date_from`,`date_to`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

