/*Table structure for table `app_promotion_urls` */

DROP TABLE IF EXISTS `app_promotion_urls`;

CREATE TABLE `app_promotion_urls` (
  `processflag` varchar(5) DEFAULT NULL COMMENT 'en procesos etl indica estados de preprocesamiento',
  `insert_platform` varchar(3) DEFAULT '1' COMMENT 'desde que plataforma se ha realizado la creacion, mobile, web, api',
  `insert_user` varchar(15) DEFAULT NULL COMMENT 'creador (no necesariamente en base_user) puede ser un proceso ETL',
  `insert_date` datetime DEFAULT current_timestamp() COMMENT 'datetime de la creacion',
  `update_platform` varchar(3) DEFAULT NULL,
  `update_user` varchar(15) DEFAULT NULL,
  `update_date` datetime DEFAULT current_timestamp(),
  `delete_platform` varchar(3) DEFAULT NULL,
  `delete_user` varchar(15) DEFAULT NULL,
  `delete_date` datetime DEFAULT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` varchar(50) DEFAULT NULL,
  `id_owner` int(11) NOT NULL COMMENT 'base_user.id',
  `code_erp` varchar(25) DEFAULT NULL,
  `description` varchar(250) DEFAULT NULL,
  `id_promotion` int(11) NOT NULL,
  `id_type` int(11) NOT NULL COMMENT 'app_array.type=''promotion'' ticktock, fb, twitter, instagram, other',
  `url_design` varchar(300) DEFAULT NULL COMMENT 'la url del diseño en la red social',
  `url_promotion` varchar(300) DEFAULT NULL COMMENT 'la url de la promoción en la red social',
  `notes` varchar(300) DEFAULT NULL COMMENT 'notas relevantes, por ejemplo, hay que pasar el token=xxx',
  `is_active` int(2) NOT NULL DEFAULT 1 COMMENT 'para el futuro, indicará si hay que desactivar capturas desde esa publicacion',
  PRIMARY KEY (`id`),
  KEY `delete_date_idx` (`delete_date`),
  KEY `uuid_idx` (`uuid`),
  KEY `id_owner_idx` (`id_owner`),
  KEY `description_idx` (`description`),
  KEY `id_promotion_idx` (`id_promotion`),
  KEY `id_type_idx` (`id_type`),
  KEY `id__uuid_idx` (`id`,`uuid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `app_promotion_urls` */

/*Table structure for table `app_promotioncap_actions` */

DROP TABLE IF EXISTS `app_promotioncap_actions`;

CREATE TABLE `app_promotioncap_actions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_promotion` int(11) NOT NULL,
  `id_promouser` int(11) DEFAULT NULL,
  `id_type` int(2) NOT NULL COMMENT 'app_array.type=''promotion-steps'' viewed, subscribed, confirmed, executed, expired',
  `url_req` varchar(300) DEFAULT '0',
  `url_ref` varchar(300) DEFAULT NULL,
  `is_test` int(2) NOT NULL DEFAULT 0 COMMENT '0:No, 1:Yes',
  `remote_ip` varchar(15) DEFAULT NULL,
  `insert_date` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `id_promotion_idx` (`id_promotion`),
  KEY `id_promouser_idx` (`id_promouser`),
  KEY `id_type_idx` (`id_type`),
  KEY `is_test_idx` (`is_test`)
) ENGINE=MyISAM AUTO_INCREMENT=970 DEFAULT CHARSET=utf8;

