/*Table structure for table `app_promotioncap_users` */

DROP TABLE IF EXISTS `app_promotioncap_users`;

CREATE TABLE `app_promotioncap_users` (
  `processflag` varchar(5) DEFAULT NULL COMMENT 'en procesos etl indica estados de preprocesamiento',
  `insert_platform` varchar(3) DEFAULT '1' COMMENT 'desde que plataforma se ha realizado la creacion, mobile, web, api',
  `insert_user` varchar(15) DEFAULT NULL COMMENT 'creador (no necesariamente en base_user) puede ser un proceso ETL',
  `insert_date` datetime DEFAULT current_timestamp() COMMENT 'datetime de la creacion',
  `update_platform` varchar(3) DEFAULT NULL,
  `update_user` varchar(15) DEFAULT NULL,
  `update_date` datetime DEFAULT current_timestamp(),
  `delete_platform` varchar(3) DEFAULT NULL,
  `delete_user` varchar(15) DEFAULT NULL,
  `delete_date` datetime DEFAULT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` varchar(50) DEFAULT NULL,
  `id_owner` int(11) NOT NULL COMMENT 'base_user.id',
  `code_erp` varchar(25) DEFAULT NULL,
  `description` varchar(250) DEFAULT NULL,
  `id_promotion` int(11) NOT NULL,
  `id_language` int(11) DEFAULT NULL COMMENT 'app_array.type=''language'' 1: english, 2:spanish',
  `id_country` int(11) DEFAULT NULL COMMENT 'app_array.type=country',
  `phone1` varchar(20) DEFAULT NULL,
  `email` varchar(100) NOT NULL COMMENT 'siempre obligatorio',
  `birthdate` datetime DEFAULT NULL,
  `name1` varchar(30) DEFAULT NULL,
  `name2` varchar(30) DEFAULT NULL,
  `id_gender` int(2) DEFAULT NULL COMMENT 'app_array.type=gender, id_pk:0: female, 1: male, 2:neutral',
  `address` varchar(100) DEFAULT NULL,
  `is_mailing` int(2) NOT NULL DEFAULT 0 COMMENT '0: no, 1: yes',
  `is_terms` int(2) NOT NULL DEFAULT 1 COMMENT '0: no, 1: yes',
  PRIMARY KEY (`id`),
  KEY `delete_date_idx` (`delete_date`),
  KEY `uuid_idx` (`uuid`),
  KEY `id_owner_idx` (`id_owner`),
  KEY `id_promotion_idx` (`id_promotion`),
  KEY `id_language_idx` (`id_language`),
  KEY `id_country_idx` (`id_country`),
  KEY `email_idx` (`email`),
  KEY `is_mailing_idx` (`is_mailing`),
  KEY `name1_idx` (`name1`),
  KEY `id__uuid_idx` (`id`,`uuid`)
) ENGINE=MyISAM AUTO_INCREMENT=130 DEFAULT CHARSET=utf8;

